- options:
    extractCommonTypes: true
    rootName: Project
    makeMaps: false
    skipGoRun: true
  out: |
    type Project struct {
      Node
      Node Node `json:"node"`
    }

    type Node struct {
      A int `json:"a"`
      B int `json:"b"`
      C int `json:"c"`
      D int `json:"d"`
      E int `json:"e"`
      F int `json:"f"`
      G int `json:"g"`
      H int `json:"h"`
    }
